import React from 'react'

function Navegation() {
  const list=['Examenes','Pacientes','Registro']
  return (
    <div className='w-2/12 bg-gray-300  '>
        <ol>
            {list.map(elemet=>{
            return(
              <li className='p-2 text-center text-xl text-gray-700  bg-green-primary bg-opacity-60 mb-1 uppercase hover:bg-opacity-0 cursor-pointer hover:text-white'>{elemet}</li>
            )})}
        </ol>
    </div>
  )
}

export default Navegation
